import test from 'ava' ;
import { parse , stringify , pown } from '../../../../src' ;

function macro ( t , A , B , C ) {
    const a = parse( A ) ;
    const c = pown( a , B ) ;
    t.is( stringify( a ) , A ) ;
    t.is( stringify( c ) , C ) ;
}

macro.title = ( _ , A , B , C ) => `pown(${A},${B}) = ${C}` ;

